using MongoDB.Driver;
using Domain.Entities;
using System.Reflection;

namespace Infrastructure.Persistence.Seed
{
    public class DatabaseSeeder
    {
        private readonly AppDbContext _context;

        public DatabaseSeeder(AppDbContext context)
        {
            _context = context;
        }

        public void Seed()
        {
            var basePath = Path.GetDirectoryName(Assembly.GetExecutingAssembly().Location);
            var imagePath = Path.Combine(basePath, @"..\..\..\..\Core\Static\Images\casaDefault.png");

            var hasOwners = _context.Owners.Find(_ => true).Any();
            if (!hasOwners)
            {
                var owner = new OwnerEntity
                {
                    Name = "Jonathan Soto",
                    Address = "Cali, Colombia",
                    Photo = "data:image/gif;base64,",
                    Birthday = new DateTime(1995, 5, 20)
                };

                _context.Owners.InsertOne(owner);

                var property = new PropertyEntity
                {
                    Name = "Casa Bonita",
                    Address = "Calle 123",
                    Price = 250000000,
                    CodeInternal = "CASA123",
                    Year = 2020,
                    IdOwner = owner.IdOwner
                };

                _context.Properties.InsertOne(property);

                var propertyImage = new PropertyImageEntity
                {
                    IdProperty = property.IdProperty,
                    FileData = File.ReadAllBytes(imagePath),
                    Enabled = true
                };

                _context.PropertyImages.InsertOne(propertyImage);

                var trace = new PropertyTraceEntity
                {
                    IdProperty = property.IdProperty,
                    DateSale = DateTime.UtcNow,
                    Name = "Venta inicial",
                    Value = 250000000,
                    Tax = 5000000
                };

                _context.PropertyTraces.InsertOne(trace);
            }
        }
    }
}

 